"original": |2-
     -  TLS Cipher Suite Registry: Future values with the first byte in
        the range 0-191 (decimal) inclusive are assigned via Standards
        Action [RFC2434].  Values with the first byte in the range 192-254
        (decimal) are assigned via Specification Required [RFC2434].
        Values with the first byte 255 (decimal) are reserved for Private
        Use [RFC2434].
"fixed": |-
  -  TLS Cipher Suite Registry: Future values with the first byte in the range 0-191 (decimal) inclusive are assigned via Standards Action [RFC2434].  Values with the first byte in the range 192-254 (decimal) are assigned via Specification Required [RFC2434]. Values with the first byte 255 (decimal) are reserved for Private Use [RFC2434].
"ko": |-
  - TLS Cipher Suite Registry: 0-191(십진수) 범위의 첫 번째 바이트를 포함하는 미래 값은 표준 조치 [RFC2434]를 통해 할당됩니다. 192-254(십진수) 범위의 첫 번째 바이트 값은 사양 필수 [RFC2434]를 통해 할당됩니다. 첫 번째 바이트 255(10진수)의 값은 개인용으로 예약되어 있습니다[RFC2434].
